import React, { useState, useEffect } from 'react';

const Ratings = () => {
    useEffect(() => {
        fetch('http://127.0.0.1:8000/ratings/list', {
            method: 'GET',
            credentials: 'include',
        })
        .then((resp) => {
            return resp.json();
        })
        .then((data) => {
            return ratingsListHandler(data);
        })
        .catch((err) => {
            return console.error(err);
        })
    }, []);

    const ratingsListHandler = (props) => {
        console.log(props);
    };

    return (
        <div>
            <h1>Ratings</h1>
        </div>
    );
};

export default Ratings;
